import Drinks from "../Drinks/Drinks";
import "./DrinksMenu.css";

function DrinksMenu() {
  return (
    <>
      <h1>Топли пијалоци</h1>
      <div className="drinks-container">
        <Drinks />
      </div>
    </>
  );
}

export default DrinksMenu;
